        "random_text_535": MessageLookupByLibrary.simpleMessage(
            "การจ่ายค่าคอมมิชชั่นนี้ขึ้นอยู่กับการเดิมพันที่ครบเงื่อนไข โดยสมมติว่าสัดส่วนการจ่ายค่าคอมมิชชั่นที่แสดงในตารางข้างบน. โดย A เป็นคนแรกที่ค้นพบโอกาสทางธุรกิจบนเว็บไซต์นี้ และพัฒนา B1 B2 และ B3 ทันที，หลังจากนั้น B1 จึงพัฒนา C1 และ C2，ส่วน B2 ไม่มีลูกน้อง，และ B3 พัฒนาเพียง C3 ที่ค่อนข้างมีผลงานที่ดีเยี่ยมเท่านั้น.\n\nหลังจากไม่กี่วันต่อมา การเดิมพันที่ครบเงื่อนไขของ B1 คือ 80,000 ส่วน B2 คือ 50,000 และ B3 คือ 30,000，ส่วนการเดิมพันที่ครบเงื่อนไขของ C1 คือ 100,000 ส่วน C2 คือ 40,000 และ C3 มากถึง 710,000 ，ดังนั้นผลงานรวมของ B1 มาจาก C1 และ C2 ซึ่งก็คือ 140,000 และอัตราการจ่ายคอมมิชชั่นที่สอดคล้องกันคือ 80/10,000 ，ส่วนผลงานรวมของ B2 ที่ไม่มีลูกทีมคือ 0 ，และ C3 ลูกทีมของ B3 นั้นมีผลงานที่ดีเยี่ยม ผลงานรวมคือ 710,000 และการจ่ายที่สอดคล้องกันคือ 100/10,000 ，ส่วน A มี 160,000 จากทีมโดยตรง และ 850,000 จากทีมอื่น ยอดทั้งหมดคือ 1.01 ล้าน และอัตราการจ่ายที่สอดคล้องกันคือ 100/10,000.\n\nจากนั้นรายได้ของพวกเขาจะถูกคำนวณได้ดังนี้."),
        "random_text_536": MessageLookupByLibrary.simpleMessage(
            "คือสมาชิกที่พัฒนาที่อยู่ภายใต้การดูแลของคุณ เรียกรวมกันว่าทีมงานภายใต้สังกัด.\n(1) B1, B2 และ B3 มอบให้ A: (80,000 + 50,000 + 30,000) x 100/10,000 = 1,600.\n\n(2) C1 และ C2 มอบให้ B1: (100,000+40,000)x80/10,000=1,120.\n\n(3) C3 มอบให้ B3: 710,000 x 100/10,000 = 7,100."),
        "random_text_537": MessageLookupByLibrary.simpleMessage(
            "หมายถึงB1 B2 B3 C1 C2 C3...ได้รับการพัฒนา และเรียกรวมกันว่าทีมอื่นๆของ A เนื่องจากระบบนี้สามารถพัฒนาลูกทีมได้อย่างไม่มีที่สิ้นสุด เพื่อการเข้าใจที่ง่าย บทความนี้จึงยกตัวอย่างโครงสร้าง 2 ระดับเป็นตัวอย่างเพื่ออธิบาย.\n\n(1) จาก C1 และ C2: เนื่องจาก B1 มีผลการดำเนินงานรวม 140,000 และมีอัตราค่าคอมมิชชั่นเพียง 80/10,000 ในขณะที่ผลการดำเนินงานของ A อยู่ที่ 1.01 ล้าน จีงมีอัตราส่วนค่าคอมมิชชั่น 100/10,000 ซึ่งเงินค่าคอมมิชชั่นระหว่าง A และ B1 มีส่วนต่างคือ: 100-80=20/10,000 ความแตกต่างนี้เป็นส่วนที่ C1 และ C2 มอบให้ A ดังนั้น C1 และ C2 มีส่วนทำให้ A: (100,000+40,000)×20/10,000= 280\n\n(2) จาก C3: เนื่องจาก B3 มีผลการดำเนินงานรวม 710,000 และมีอัตราส่วนค่าคอมมิชชั่นคือ 100/10,000 และ A มีผลการดำเนินงานรวม 1.01 ล้านและมีอัตราค่าคอมมิชชั่น 100/10,000 ดังนั้นส่วนต่างของค่าคอมมิชชั่นระหว่าง A และ B3 คือ: 100-100=0/10,000 ส่วนC3 มีส่วนทำให้ A: 710,000x0/10,000=0"),
