        "vip_recharge_bonus_is_valid_until": m24,
        "vip_rule_content": MessageLookupByLibrary.simpleMessage(
            "1. เกณฑ์โปรโมชัน: หากคุณมีคุณสมบัติตรงตามข้อกำหนดสำหรับโปรโมชัน VIP (นั่นคือ คุณตรงตามเงื่อนไขสำหรับรหัสทั้งหมด) คุณสามารถได้รับการเลื่อนระดับเป็นระดับ VIP ที่เกี่ยวข้องและรับโบนัสโปรโมชันที่เกี่ยวข้อง หากคุณเลื่อนติดต่อกัน คุณสามารถรับโบนัสเลื่อนตำแหน่งทั้งหมด\n\n2. โบนัสรายวัน : หากคุณมีคุณสมบัติตรงตามข้อกำหนดโบนัสรายวันที่สอดคล้องกับระดับ VIP คุณสามารถรับโบนัสรายวันที่เกี่ยวข้อง ซึ่งจะรีเซ็ตเวลา 00:00 น.ของทุกวัน \n\n3. โบนัสรายสัปดาห์: หากคุณมีคุณสมบัติตรงตามข้อกำหนดโบนัสรายสัปดาห์ที่สอดคล้องกับระดับ VIP คุณสามารถรับโบนัสรายสัปดาห์ที่สอดคล้องกัน ทุกวันจันทร์เวลา 00:00 ; \n\n4. โบนัสนรายเดือน: หากคุณเติมเงินและรหัส ทุกเดือนเพื่อให้เป็นไปตามข้อกำหนดโบนัสรายเดือนที่สอดคล้องกับระดับ VIP ปัจจุบัน คุณสามารถรับโบนัสรายเดือนที่เกี่ยวข้องได้ โดยรีเซ็ตเวลา 00:00 น. ของวันที่ 1 ของแต่ละเดือน \n\n5. คำแนะนำในการบำรุงรักษาระดับ: หลังจากที่สมาชิกถึงระดับที่กำหนด ระดับ VIP หากการเติมเงินและการเข้ารหัสในเดือนที่แล้วไม่ตรงตามข้อกำหนดในการบำรุงรักษา สมาชิกจะถูกลดระดับลงหนึ่งระดับโดยอัตโนมัติ \n\n6 คำแนะนำในการตรวจสอบ: โบนัสที่ VIP มอบให้จะต้องทบ 1 ครั้ง ( เช่น การตรวจสอบ การเข้ารหัส หรือการเดิมพันที่ถูกต้อง) สามารถถอนออกได้ และการเข้ารหัสไม่จำกัดเฉพาะแพลตฟอร์มเกม \n\n7. คำชี้แจงกิจกรรม: ฟังก์ชั่นนี้จำกัดเฉพาะเจ้าของบัญชีสำหรับการเดิมพันเกมปกติ บัญชีเช่า การโกง การเก็งกำไรที่เป็นอันตราย การใช้ปลั๊กอิน โรบอต การใช้ประโยชน์จากโปรโตคอล ช่องโหว่ อินเทอร์เฟซ การควบคุมกลุ่ม หรือวิธีการทางเทคนิคอื่น ๆ เมื่อตรวจสอบแล้ว แพลตฟอร์มจะมีสิทธิ์ ยุติการเข้าสู่ระบบของสมาชิก ระงับสมาชิกจากการใช้เว็บไซต์ และริบโบนัส และสิทธิ์ในการทำกำไรที่ไม่เหมาะสมโดยไม่ต้องแจ้งให้ทราบล่วงหน้า \n\n8 คำอธิบาย: เมื่อสมาชิกได้รับรางวัล VIP แพลตฟอร์มนี้จะถือว่าสมาชิกตกลงและปฏิบัติตามเงื่อนไขที่เกี่ยวข้องและ กฎระเบียบที่เกี่ยวข้องอื่น ๆ เพื่อหลีกเลี่ยงความคลุมเครือในการทำความเข้าใจต้นฉบับแพลตฟอร์มนี้ขอสงวนสิทธิ์ขั้นสุดท้ายของสิทธิ์ในการตีความเหตุการณ์นี้"),
